  `real_name` varchar(255) DEFAULT '' COMMENT '姓名',
  `phone` varchar(255) DEFAULT '' COMMENT '手机',
  `province` varchar(255) DEFAULT '',
  `city` varchar(255) DEFAULT '',
  `county` varchar(255) DEFAULT '',
  `address` varchar(255) DEFAULT '',
  `specific_address` varchar(255) DEFAULT '' COMMENT '具体地址',
  `longitude` varchar(255) DEFAULT '' COMMENT '经度',
  `latitude` varchar(255) DEFAULT '' COMMENT '纬度',
  `customer_service` varchar(255) DEFAULT '' COMMENT '客服电话',
  `sales` int(11) DEFAULT '0' COMMENT '销量',
  `collect` int(11) DEFAULT '0' COMMENT '收藏',
  `recommend` tinyint(1) DEFAULT '0' COMMENT '0默认 1推荐',
  `sort` int(11) DEFAULT '0' COMMENT '从大到小',
  `status` tinyint(1) DEFAULT '1' COMMENT '0禁止 1正常 2审核中 3未通过',
