  `integral` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `order` smallint(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `sales` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `ficti` int(11) DEFAULT '0' COMMENT '虚拟销量',
  `stock` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `is_show` tinyint(1) NOT NULL COMMENT '状态（0：未上架，1：上架）',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `browse` int(11) DEFAULT '0' COMMENT '浏览量',
  `add_time` int(11) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COMMENT='积分商品表';

