-- ----------------------------
-- Table structure for eb_store_combination
-- ----------------------------
DROP TABLE IF EXISTS `eb_store_combination`;
CREATE TABLE `eb_store_combination` (
  `id` mediumint(11) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `mer_id` int(11) DEFAULT '0',
  `product_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品id',
  `image` varchar(255) NOT NULL COMMENT '商品图片',
  `images` varchar(1000) DEFAULT '',
  `title` varchar(255) DEFAULT '',
  `price` decimal(10,2) NOT NULL COMMENT '拼团价格',
  `ot_price` decimal(10,2) DEFAULT '0.00' COMMENT '原价',
  `limit_num` int(11) unsigned DEFAULT '0' COMMENT '限制购买数量 0为不限制',
  `stock` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `unit_name` varchar(255) DEFAULT '',
  `sort` smallint(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `sales` int(11) DEFAULT '0' COMMENT '销量',
  `is_postage` tinyint(1) DEFAULT '0',
  `cost` decimal(10,2) DEFAULT '0.00' COMMENT '成本',
  `postage` decimal(10,2) DEFAULT '0.00',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `stop_time` int(11) NOT NULL COMMENT '结束时间',
  `add_time` int(11) unsigned NOT NULL COMMENT '添加时间',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态（0：未上架，1：上架）',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `act_desc` varchar(1000) DEFAULT '' COMMENT '活动描述',
  `status` tinyint(1) DEFAULT '0' COMMENT '是否开启，0不开，1开启',
  `com_type` tinyint(1) DEFAULT '1' COMMENT '团类型1大团，2小团，3老带新，4阶梯团',
  `min_people` int(11) DEFAULT '0' COMMENT '最小成团人数',
  `is_24_auto_over` tinyint(1) DEFAULT '0' COMMENT '是否自动成团，0不，1自动成团（24h自动成团，不管人数是否到达）',
  `full_people_auto_over` tinyint(1) DEFAULT '0' COMMENT '满人成团，0关闭，1开启，满足最大阶梯人数自动成团',
  `is_over` tinyint(1) DEFAULT '0' COMMENT '活动结束：0未结束，1已经结束',
  `description` text,
  `give_integral` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='拼团产品表';

