-- ----------------------------
-- Table structure for eb_store_coupon
-- ----------------------------
DROP TABLE IF EXISTS `eb_store_coupon`;
CREATE TABLE `eb_store_coupon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '优惠券表ID',
  `mer_id` int(11) unsigned DEFAULT '0' COMMENT '商户id',
  `title` varchar(255) NOT NULL COMMENT '优惠券名称',
  `coupon_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '兑换的优惠券面值',
  `use_min_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '最低消费多少金额可用优惠券',
  `sort` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态（0：关闭，1：开启, 2:已过期）',
  `add_time` int(11) unsigned DEFAULT '0' COMMENT '兑换项目添加时间',
  `is_del` tinyint(1) unsigned DEFAULT '0' COMMENT '是否删除',
  `coupon_type` tinyint(1) DEFAULT '1' COMMENT '优惠券类型  1代金券，2折扣',
  `self_can_get` tinyint(1) DEFAULT '0' COMMENT '用户自己可也在页面领取 0不行，1可以',
  `self_max_num` int(1) unsigned DEFAULT '1' COMMENT '每人最多可领取几次',
  `is_limit` tinyint(1) DEFAULT '1' COMMENT '1限量 0不限量',
  `coupon_num` int(11) DEFAULT '0' COMMENT '优惠券数量',
  `coupon_products` varchar(255) DEFAULT '' COMMENT '产品id ，间隔',
  `coupon_discount` decimal(3,2) unsigned DEFAULT '1.00' COMMENT '折扣率  0-1  0 为免费',
  `time_type` tinyint(1) unsigned DEFAULT '1' COMMENT '时间类型，1天数，2时间段',
  `coupon_long_time` int(11) DEFAULT '0' COMMENT '优惠券持续时间',
  `coupon_start_time` int(11) DEFAULT '0' COMMENT '开始时间戳',
  `coupon_end_time` int(11) DEFAULT '0' COMMENT '结束时间戳',
  `integral` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '兑换消耗积分值',
  `coupon_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券有效期限（单位：天）',
  PRIMARY KEY (`id`),
  KEY `state` (`status`) USING BTREE,
  KEY `add_time` (`add_time`) USING BTREE,
  KEY `coupon_time` (`coupon_time`) USING BTREE,
  KEY `is_del` (`is_del`) USING BTREE,
  KEY `mer_id` (`mer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='优惠券表';

